import React from 'react'
import Navbar from './Navbar'
import Header from './Header'
import Particles from 'react-particles-js'

const Home = () => {
    return (
        <>
            <Particles>
                params={{
                    particles: {
                        number: {
                            value: 45
                        }
                    }
                }}
            </Particles>
            <Navbar />
            <Header />
        </>
    )
}

export default Home;
